"""Given a roman numeral, convert it to an integer.Input is guaranteed to be within the range from 1 to 3999."""class Solution:    def romanToInt(self, s):        """        :type s: str        :rtype: int        """        flag = 1        romanDict = {'I':[1,1], 'V':[2,5],'X':[3,10],'L':[4,50],'C':[5,100],'D':[6,500],'M':[7,1000]}        sum=0        for i in reversed(s):            if romanDict[i][0]>=flag:                sum = sum+romanDict[i][1]                flag=romanDict[i][0]            else:                sum = sum-romanDict[i][1]        return sum